import React from 'react';
import {
  Typography,
  Box,
  Container,
  Card,
  CardContent,
  Grid,
  ThemeProvider,
  createTheme,
  Fade,
  Chip
} from '@mui/material';
import WorkIcon from '@mui/icons-material/Work';
import ConstructionIcon from '@mui/icons-material/Construction';

const theme = createTheme({
  typography: {
    fontFamily: 'Arial, sans-serif',
  },
  palette: {
    primary: {
      main: '#4CAF50',
    },
  },
});

const Projects: React.FC = () => {
  return (
    <ThemeProvider theme={theme}>
      <Container maxWidth="md">
        <Box sx={{ padding: 4 }}>
          <Typography 
            variant="h4" 
            gutterBottom 
            color="primary" 
            sx={{ 
              borderBottom: '2px solid #4CAF50',
              paddingBottom: 1,
              marginBottom: 4,
              display: 'inline-block'
            }}
          >
            <WorkIcon sx={{ verticalAlign: 'middle', marginRight: 1 }} />
            Projects
          </Typography>

          <Fade in={true} timeout={1000}>
            <Card elevation={3} sx={{ 
              mb: 4, 
              p: 2,
              transition: 'all 0.3s',
              '&:hover': {
                transform: 'scale(1.01)',
                boxShadow: 6,
              },
            }}>
              <CardContent>
                <Grid container spacing={2} alignItems="center" justifyContent="center">
                  <Grid item>
                    <ConstructionIcon sx={{ fontSize: 60, color: 'primary.main' }} />
                  </Grid>
                  <Grid item>
                    <Typography variant="h5" align="center" gutterBottom>
                      Work in Progress
                    </Typography>
                    <Typography variant="body1" align="center">
                      Exciting projects are currently under development. 
                      Check back soon for updates!
                    </Typography>
                  </Grid>
                </Grid>
              </CardContent>
            </Card>
          </Fade>

          <Fade in={true} timeout={1500}>
            <Grid container spacing={3}>
              {[1, 2].map((item) => (
                <Grid item xs={12} sm={4} key={item}>
                  <Card elevation={3} sx={{
                    height: '100%',
                    display: 'flex',
                    flexDirection: 'column',
                    transition: 'all 0.3s',
                    '&:hover': {
                      transform: 'scale(1.03)',
                      boxShadow: 6,
                    }
                  }}>
                    <CardContent sx={{ flexGrow: 1 }}>
                      <Typography variant="h6" component="div" color="primary" gutterBottom>
                        Project {item}
                      </Typography>
                      <Typography variant="body2" color="text.secondary">
                        Description of the project will be added here.
                      </Typography>
                    </CardContent>
                    <Box sx={{ p: 2, pt: 0 }}>
                      <Chip label="Coming Soon" color="primary" variant="outlined" />
                    </Box>
                  </Card>
                </Grid>
              ))}
            </Grid>
          </Fade>
        </Box>
      </Container>
    </ThemeProvider>
  );
}

export default Projects;
